import React from 'react';
import Navbar from '../../components/navbar/NavbarFreelancer';
import {useEffect , usestate} from 'react';

const ProfileFreelancer = () => {

    useEffect(() => {
        const fetchProfileData = async () => {
          try {
            const { data } = await axios.get(
              "http://localhost:8001/profile", // Replace with your API endpoint
              { withCredentials: true }
            );
    
            const { success, profile } = data;
            if (success) {
              setInputValue(profile);
            } else {
              handleError("Failed to fetch profile data");
            }
          } catch (error) {
            console.log(error);
          }
        };
    
        fetchProfileData();
      }, []);
  return (
    <>
        <Navbar/>
        <div>
            <h2>Profile</h2>
        </div>
 
    </>
    );
};

export default ProfileFreelancer;
